import {
  Table,
  Row,
  Col,
  Container,
  Form,
  Modal,
  Button,
} from "react-bootstrap";
import { useState, useContext } from "react";
import { DataContext } from "../../Data/DataContext";
import "./Covid.css";
import Tr from "../Clinic/Tr";
import { InputGroup, FormControl } from "react-bootstrap";
import $ from "jquery";
import Header from "../../Components/Header/Header";
import "https://maps.googleapis.com/maps/api/js?key=AIzaSyDghzqDu9_LL2jecs2akSpEFLbA9gbmJjE&callback=initMap";

function Covid() {
  const [
    nav,
    setNav,
    admin,
    setAdmin,
    user,
    setUser,
    clinic,
    setClinic,
    ads,
    setAds,
    userModal,
    setUserModal,
    useredit,
    setUseredit,
  ] = useContext(DataContext);
  const [covidModal, setCovidModal] = useState(false);
  const [mapdModal, setMapModal] = useState(false);

  // Thus function to update user user
  const editRowDone = () => {
    var name = $("#edit_name").val(),
      phone = $("#edit_phone").val(),
      email = $("#edit_email").val(),
      password = $("#edit_password").val(),
      city = $("#edit_city").val();
    $.ajax({
      url: "http://touch.extra-laboratory.com/api/edit_user.php",
      type: "post",
      data: {
        id: useredit.id,
        name: name,
        phone: phone,
        email: email,
        password: password,
        city: city,
      },
      success: function (data) {
        if (data.code == 200) {
          $.ajax({
            url: "http://touch.extra-laboratory.com/api/get_users.php",
            success: function (data) {
              setUser(data);
            },
            error: function (error) {
              console.log(error);
            },
          });
          $.ajax({
            url: "http://touch.extra-laboratory.com/api/get_clinics.php",
            success: function (data) {
              setClinic(data);
            },
            error: function (error) {
              console.log(error);
            },
          });
          setUserModal(false);
        } else alert(data.message);
      },
      error: function (error) {
        console.log(error);
      },
    });
  };

  // map code function .............................................................................
  function initMap() {
    var map;
    var mapEarea = document.getElementById("map");
    var location_lat = document.getElementById("location_lat");
    var location_lng = document.getElementById("location_lng");
    // option to set the default center and zoom for the map
    var mapOptions = {
      center: { lat: 15.577379198863051, lng: 32.535586921139384 },
      zoom: 10,
    };

    // create new instance from google map class to drow the map
    map = new google.maps.Map(mapEarea, mapOptions);

    // options to add marker we have to set position and the map object the theard
    // option to make the marker dreaggble so you can move int when ever you wont
    var markerOption = {
      position: mapOptions.center,
      map: map,
      Draggable: false,
    };

    // create new instance from google map marker class to drop the marker
    var marker = new google.maps.Marker(markerOption);

    // creake click event on the map to change marker position by clicking any where in the map
    google.maps.event.addListener(map, "click", function (e) {
      marker.setPosition({
        lat: e.latLng.lat(),
        lng: e.latLng.lng(),
      });

      console.log(marker.position.lat() + " " + marker.position.lng());
      location_lat.value = marker.position.lat();
      location_lng.value = marker.position.lng();
    });
  }

  return (
    <div>
      <Header />
      <br />
      <br />
      <br />
      <br />
      <br />
      <Container>
        <Row style={{ overflow: "auto", height: "90vh", width: "100%" }}>
          <Col md={12} xs={12}>
            {/* <div>
              <img
                src="../assets/icons/search.svg"
                style={{ position: "absolute", margin: "10px" }}
              />
              <Form.Control
                style={{ paddingLeft: " 100px" }}
                type="search"
                id="inputPassword5"
                aria-describedby="passwordHelpBlock"
              />
            </div> */}
            <Button
              onClick={() => setCovidModal(true)}
              style={{
                backgroundColor: "black",
                marginBottom: "10px",
                position: "absolute",
                marginTop: "-50px",
              }}
            >
              Add new +
            </Button>
            <Table
              className="table-borderless"
              striped
              bordered
              hover
              variant="dark"
            >
              <thead>
                <tr>
                  <th>#</th>
                  <th>Full Name</th>
                  <th>Phone</th>
                  <th>Email</th>
                  <th>City</th>
                  <th>Account</th>
                  <th>Date</th>
                  <th>Edit</th>
                  <th>Delete</th>
                </tr>
              </thead>
              <tbody>
                {user.data.map((data) => (
                  <Tr
                    name={data.name}
                    phone={data.phone}
                    email={data.email}
                    city={data.city}
                    account={data.app}
                    date={data.date}
                    dalet={data.id}
                    delete={data.id}
                    type="user"
                  />
                ))}
              </tbody>
            </Table>
          </Col>
        </Row>
      </Container>
      <Modal
        show={userModal}
        onHide={() => setUserModal(false)}
        size="lg"
        aria-labelledby="contained-modal-title-vcenter"
        centered
      >
        <Modal.Header closeButton>
          <Modal.Title id="contained-modal-title-vcenter">
            Manageing Users
          </Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <InputGroup className="mb-3">
            <InputGroup.Text id="inputGroup-sizing-default">
              Full Name
            </InputGroup.Text>
            <FormControl
              id="edit_name"
              defaultValue={useredit.name}
              aria-label="Default"
              aria-describedby="inputGroup-sizing-default"
            />
          </InputGroup>
          <InputGroup className="mb-3">
            <InputGroup.Text id="inputGroup-sizing-default">
              Phone
            </InputGroup.Text>
            <FormControl
              id="edit_phone"
              defaultValue={useredit.phone}
              aria-label="Default"
              aria-describedby="inputGroup-sizing-default"
            />
          </InputGroup>
          <InputGroup className="mb-3">
            <InputGroup.Text id="inputGroup-sizing-default">
              Email
            </InputGroup.Text>
            <FormControl
              id="edit_email"
              defaultValue={useredit.email}
              aria-label="Default"
              aria-describedby="inputGroup-sizing-default"
            />
          </InputGroup>
          <InputGroup className="mb-3">
            <InputGroup.Text id="inputGroup-sizing-default">
              Password
            </InputGroup.Text>
            <FormControl
              id="edit_password"
              defaultValue={useredit.password}
              aria-label="Default"
              aria-describedby="inputGroup-sizing-default"
            />
          </InputGroup>
          <InputGroup className="mb-3">
            <InputGroup.Text id="inputGroup-sizing-default">
              City
            </InputGroup.Text>
            <FormControl
              id="edit_city"
              defaultValue={useredit.city}
              aria-label="Default"
              aria-describedby="inputGroup-sizing-default"
            />
          </InputGroup>
          <InputGroup className="mb-3">
            <InputGroup.Text id="inputGroup-sizing-default">
              Account type
            </InputGroup.Text>
            <FormControl
              id="edit_app"
              defaultValue={useredit.app}
              aria-label="Default"
              aria-describedby="inputGroup-sizing-default"
            />
          </InputGroup>
        </Modal.Body>
        <Modal.Footer>
          <Button onClick={() => editRowDone()}>Make edit</Button>
          <Button onClick={() => setUserModal(false)}>Close</Button>
        </Modal.Footer>
      </Modal>

      <Modal
        show={covidModal}
        onHide={() => setCovidModal(true)}
        size="lg"
        aria-labelledby="contained-modal-title-vcenter"
        centered
      >
        <Modal.Header closeButton>
          <Modal.Title id="contained-modal-title-vcenter">
            Covid-19 new test
          </Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <InputGroup className="mb-3">
            <InputGroup.Text
              id="inputGroup-sizing-default"
              style={{ width: "150px" }}
            >
              Full Name
            </InputGroup.Text>
            <FormControl
              id="edit_name"
              defaultValue={useredit.name}
              aria-label="Default"
              aria-describedby="inputGroup-sizing-default"
            />
          </InputGroup>
          <InputGroup className="mb-3">
            <InputGroup.Text
              id="inputGroup-sizing-default"
              style={{ width: "150px" }}
            >
              Phone
            </InputGroup.Text>
            <FormControl
              id="edit_phone"
              defaultValue={useredit.phone}
              aria-label="Default"
              aria-describedby="inputGroup-sizing-default"
            />
          </InputGroup>
          <InputGroup className="mb-3">
            <InputGroup.Text
              id="inputGroup-sizing-default"
              style={{ width: "150px" }}
            >
              Email
            </InputGroup.Text>
            <FormControl
              id="edit_email"
              defaultValue={useredit.email}
              aria-label="Default"
              aria-describedby="inputGroup-sizing-default"
            />
          </InputGroup>
          <InputGroup className="mb-3">
            <InputGroup.Text
              id="inputGroup-sizing-default"
              style={{ width: "150px" }}
            >
              Address
            </InputGroup.Text>
            <FormControl
              id="edit_password"
              defaultValue={useredit.password}
              aria-label="Default"
              aria-describedby="inputGroup-sizing-default"
            />
          </InputGroup>
          <InputGroup className="mb-3">
            <Button
              variant="outline-secondary"
              id="button-addon1"
              style={{ width: "150px" }}
              onClick={() => setMapModal(true)}
            >
              <img
                src="./assets/img/map.png"
                style={{ width: "30px", float: "left" }}
              />
            </Button>
            <FormControl
              aria-label="Example text with button addon"
              aria-describedby="basic-addon1"
            />
          </InputGroup>
          <InputGroup>
            <InputGroup.Text style={{ width: "150px" }}>
              With textarea
            </InputGroup.Text>
            <FormControl as="textarea" aria-label="With textarea" />
          </InputGroup>
        </Modal.Body>
        <Modal.Footer>
          <Button onClick={() => editRowDone()}>Make edit</Button>
          <Button onClick={() => setCovidModal(false)}>Close</Button>
        </Modal.Footer>
      </Modal>

      {/* <!--// this for map ...................................................................... --> */}
      <Modal
        show={mapdModal}
        onHide={() => setMapModal(true)}
        size="lg"
        aria-labelledby="contained-modal-title-vcenter"
        centered
      >
        <Modal.Header>
          <Modal.Title id="contained-modal-title-vcenter">
            Choose the loaction from map
          </Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <div id="map1" data-role="dialog">
            <a
              href="#signup"
              className="ui-btn ui-icon-delete ui-btn-icon-notext ui-btn-corner-all ui-btn-right "
            ></a>
            <div id="map"></div>
            <input type="text" id="location_lat" />
            <input type="text" id="location_lng" />
          </div>
        </Modal.Body>
        <Modal.Footer>
          <Button onClick={() => editRowDone()}>Set loaction</Button>
          <Button onClick={() => setMapModal(false)}>Close</Button>
        </Modal.Footer>
      </Modal>
    </div>
  );
}

export default Covid;
